    "7306140": {
        "Desc": "Usa el poder de kusava para romper el sello de la setasura",
        "Step": "",
        "Talk": [
            [
                {
                    "N": "Lunja",
                    "T": "¡Minum, Ziri, la tengo! ¡Encuentren a un mensajero para que informe al cliente! ¡Nos vamos de inmediato!"
                },
                {
                    "N": "Lunja",
                    "T": "#Fue {F#una adversaria}{M#un adversario} formidable. Ni siquiera la zona marchita pudo detenerl{F#a}{M#o}. Además, Anqa e Isan resultaron heridos. Deberíamos aprovechar antes de que nos alcance..."
                },
                {
                    "N": "Minum",
                    "T": "Jefa..."
                },
                {
                    "N": "Lunja",
                    "T": "¿No escuchaste lo que te dije? ¡¿A qué estas esperando?!"
                },
                {
                    "N": "Ziri",
                    "T": "Ya nos ha alcanzado."
                },
                {
                    "N": "Lunja",
                    "T": "..."
                },
                {
                    "N": "_0",
                    "T": "#Soy {F#toda}{M#todo} oídos, continúa."
                },
                {
                    "N": "_0",
                    "T": "#¿Así es como tratas a tus amig{F#as}{M#os}?"
                },
                {
                    "N": "Lunja",
                    "T": "*Suspira*... Eres como una sombra."
                },
                {
                    "N": "Lunja",
                    "T": "#Lo siento, amig{F#as}{M#os} mí{F#as}{M#os}. Solamente queríamos obtener la setasura para nuestro cliente. Son solo negocios, no es nada personal."
                },
                {
                    "N": "_1005",
                    "T": "#¿“Amig{F#as}{M#os}”? ¿Todavía te atreves a decir que somos amig{F#as}{M#os}?"
                },
                {
                    "N": "Lunja",
                    "T": "¿A qué te refieres, pequeñina? ¡Ya me disculpé! Vamos, es agua pasada."
                },
                {
                    "N": "_1005",
                    "T": "¡Hum! ¡Qué descarada!"
                },
                {
                    "N": "Lunja",
                    "T": "Hablando en serio, ya probaron lo fuertes que son derrotando a Anqa y a Isan."
                },
                {
                    "N": "Lunja",
                    "T": "#Admiro a guerrer{F#as}{M#os} como ustedes. Poder ser su amiga es un honor para mí. Pero estoy segura de que lo comprenden, ¿verdad? Los negocios son negocios. No quisiera poner fin a nuestra amistad por esto."
                },
                {
                    "N": "Lunja",
                    "T": "¡Sería una verdadera lástima perder tan valiosa amistad por un negocio tan insignificante como este!"
                },
                {
                    "N": "_0",
                    "T": "Deja de andarte por las ramas."
                },
                {
                    "N": "_0",
                    "T": "Entréganos la setasura."
                },
                {
                    "N": "Lunja",
                    "T": "#Calma, {F#amigas mías}{M#amigos míos}. Son ustedes {F#las}{M#los} que están en desventaja. ¿Van a arriesgar sus vidas por esto? Muy bien."
                },
                {
                    "N": "Lunja",
                    "T": "Pero no quiero que más de mi gente salga lastimada por un miserable hongo. No vale la pena, así que hagamos un trato."
                },
                {
                    "N": "_1005",
                    "T": "¿Quién confiaría en una estafadora como tú?"
                },
                {
                    "N": "Lunja",
                    "T": "#Eso depende del precio que estén dispuest{F#as}{M#os} a pagar."
                }
            ]
        ]
    },
