        "Talk": [
            [
                {
                    "N": "_1005",
                    "T": "Qué tipos más raros. Parecían desesperados por caernos bien..."
                },
                {
                    "N": "_0",
                    "T": "Deberíamos andarnos con cuidado."
                },
                {
                    "N": "Aranakin",
                    "T": "Sí, sí, tengan cuidado."
                },
                {
                    "N": "_1005",
                    "T": "Bueno, ya que ambos están de acuerdo..."
                },
                {
                    "N": "_1005",
                    "T": "¡¿Eh?!"
                },
                {
                    "N": "Aranakin",
                    "T": "¡¿Eh?!"
                },
                {
                    "N": "Aranakin",
                    "T": "¡Aaah! ¡Qué susto!"
                },
                {
                    "N": "_1005",
                    "T": "¡Eso es justo lo que Paimon iba a decir!"
                },
                {
                    "N": "_1005",
                    "T": "Humm... Por cierto, ¿quién eres tú, cosita?"
                },
                {
                    "N": "Aranakin",
                    "T": "¡Aranakin no es ninguna “cosita”! ¡Aranakin es Aranakin!"
                },
                {
                    "N": "Aranakin",
                    "T": "No se puede confiar en arena, es engañosa. ¡Viene tras aranara con malas intenciones!"
                },
                {
                    "N": "_0",
                    "T": "¿Malas intenciones?"
                },
                {
                    "N": "Aranakin",
                    "T": "¡Malas intenciones! ¡Malas intenciones!"
                },
                {
                    "N": "_0",
                    "T": "¿A qué te refieres con “arena”?"
                },
                {
                    "N": "Aranakin",
                    "T": "Arena es valuka, y valuka es arena. A Aranakin no le gusta arena. Arena áspera, irritante y en todas partes."
                },
                {
                    "N": "_1005",
                    "T": "¿Qué...? Paimon no lo entiende."
                },
                {
                    "N": "Aranakin",
                    "T": "Cosa blanca voladora es tonta, por eso no entiende."
                },
                {
                    "N": "_1005",
                    "T": "¡Oye!"
                },
                {
                    "N": "_0",
                    "T": "Se refiere a esas personas de antes."
                },
                {
                    "N": "_0",
                    "T": "Esos tipos de antes deben de traerse algo entre manos."
                },
                {
                    "N": "Aranakin",
                    "T": "#Nara {NICKNAME} es muy inteligente, a eso se refiere Aranakin."
                },
                {
                    "N": "_1005",
                    "T": "¿Eh? ¿Sabes nuestros nombres?"
                },
                {
                    "N": "Aranakin",
                    "T": "#Aranakin es muy listo. Cuando ustedes hablaron con arena, Aranakin escuchó. Oyó que nombre de nara es “{NICKNAME}”, y tuyo es “Paimon”. Pero Paimon voladora es muy tonta, no entiende a Aranakin."
                },
                {
                    "N": "_0",
                    "T": "Sin duda alguna, esa es Paimon voladora."
                },
                {
                    "N": "_1005",
                    "T": "¡Oye! ¡Paimon no es tonta!"
                },
                {
                    "N": "_0",
                    "T": "Venimos de parte de Aragaru."
                },
                {
                    "N": "Aranakin",
                    "T": "Aranakin sabe. Mensaje pasó de hierba en hierba y de árbol en árbol hasta llegar a Aranakin. ¡Así que Aranakin sabía que vendrían!"
                },
                {
                    "N": "Aranakin",
                    "T": "Moutiyima se siente mal. Marana cada vez más grande. ¡Debemos darnos prisa! ¡Rápido!"
                },
                {
                    "N": "_1005",
                    "T": "E-espera, ¡ni siquiera sabemos a dónde ir!"
                },
                {
                    "N": "Aranakin",
                    "T": "¡Setasura! ¡Necesitamos setasura para preparar arahaoma y que Moutiyima recupere energías!"
                },
                {
                    "N": "Aranakin",
                    "T": "Aranakin sabe dónde hay setasura, ¡Aranaki lleva a ustedes!"
                },
                {
                    "N": "_1005",
                    "T": "E-está bien... ¡Oye, espera!"
                }
            ]
        ]
