    "7306616": {
        "Desc": "Habla con Aranaga",
        "Step": "Parece que Aranaga tiene algo que decirte.",
        "Talk": [
            [
                {
                    "N": "_1005",
                    "T": "¡Aquí está la hierba yajña!"
                },
                {
                    "N": "Aranaga",
                    "T": "Esperar, por favor. Dejar que Aranaga hablar con hierba yajña."
                },
                {
                    "N": "_1005",
                    "T": "Aunque Aranaga dice que este es su jardín, aquí solo hay una triste hierba yajña..."
                },
                {
                    "N": "Aranaga",
                    "T": "Antes, muchas. Cada vez que luna subir y bajar, ir y venir, crecer una hierba yajña."
                },
                {
                    "N": "Aranaga",
                    "T": "Pero Marana venir, y con Marana venir champiñones andantes que solo saber comer. Muchas plantas morir, y ahora solo quedar esta."
                },
                {
                    "N": "_1005",
                    "T": "¿Qué harán después de usar la hierba araña para hacer el arahaoma?"
                },
                {
                    "N": "Aranaga",
                    "T": "Ser “hierba yajña”, champiñón blanco tonto. Pero no preocupar, cosa tonta. Jamikayomars conservar semillas importantes y cuidar puerta grande de Moutiyima."
                },
                {
                    "N": "_1005",
                    "T": "Ajá..."
                },
                {
                    "N": "_0",
                    "T": "Te quedaste en la parte en la que dijo “hierba yajña”, ¿cierto?"
                },
                {
                    "N": "_0",
                    "T": "No hay tiempo que perder. Llevémonos la hierba yajña."
                },
                {
                    "N": "???",
                    "T": "Aranaga le susurra algo a la planta..."
                },
                {
                    "N": "Aranaga",
                    "T": "Dice que estar dispuesta a convertirse en arahaoma."
                },
                {
                    "N": "Aranaga",
                    "T": "Y... Gracias a ustedes."
                },
                {
                    "N": "Aranaga",
                    "T": "Ahora, ir juntos a Jamikayomars."
                },
                {
                    "N": "_1005",
                    "T": "¡Guíanos, Frijolito!"
                },
                {
                    "N": "Aranaga",
                    "T": "¡Frijolito no! ¡Aranaga! ¡Cosa voladora mala!"
                },
                {
                    "N": "_1005",
                    "T": "Está bien, está bien, ¡Paimon no es mala!"
                }
            ]
        ]
    },
    "7306617": {
        "Desc": "Vuelve al pequeño jardín de Aranaga",
        "Step": "El pequeño jardín de Aranaga está cerca de Jamikayomars. Es imposible perderse.",
        "Talk": []
    },
    "7306618": {
        "Desc": "Habla con Aranaga",
        "Step": "Parece que Aranaga tiene algo que decirte.",
        "Talk": [
            [
                {
                    "N": "Aranaga",
                    "T": "¡Aquí! ¡Jamikayomars!"
                },
                {
                    "N": "Aranaga",
                    "T": "Copa de recuerdos de nara Váruna crecer aquí, por eso llamarse Jamikayomars. Jamikayomars vigilar Moutiyima, así malos no poder entrar."
                },
                {
                    "N": "_1005",
                    "T": "Pero... el Marana del que hablas, ¿dónde está?"
                },
                {
                    "N": "_0",
                    "T": "#Sí. Nosotr{F#as}{M#os} no ver sitio raro."
                },
                {
                    "N": "_1005",
                    "T": "¿Por qué hablas así?"
                },
                {
                    "N": "_0",
                    "T": "Paimon también empezar hablar así."
                },
                {
                    "N": "_1005",
                    "T": "¡Ocúpate de tus asuntos!"
                },
                {
                    "N": "Aranaga",
                    "T": "Marana entrar en Moutiyima. Por eso, haber que dar elixir arahaoma a Jamikayomars."
                },
                {
                    "N": "Aranaga",
                    "T": "Ella abrir “camino” para nosotros. Nosotros esperar que Jamikayomars recordar todo, y entonces salvar a Moutiyima."
                },
                {
                    "N": "_0",
                    "T": "¿Qué ser “arahaoma”?"
                },
                {
                    "N": "Aranaga",
                    "T": "Elixir arahaoma. Ser esencia de recuerdos y ahuyentar emisarios de muerte. Cargar con nuestros recuerdos, con nuestra fuerza vital. Eso ser elixir arahaoma."
                },
                {
                    "N": "Aranaga",
                    "T": "Preparar arahaoma necesitar tres hierbas: hierba yajña y compañeras, flor barsam y setasura."
                },
                {
                    "N": "Aranaga",
                    "T": "Debajo de luz de luna, refinarse recuerdos valiosos para completar elixir."
                },
                {
                    "N": "Aranaga",
                    "T": "Luego, ofrecer arahaoma para despertar Jamikayomars. Nuestros recuerdos entonces salir y fluir por bosque."
                },
                {
                    "N": "Aranaga",
                    "T": "Y así salvar a Moutiyima."
                },
                {
                    "N": "_0",
                    "T": "¿A qué te refieres con los “recuerdos”?"
                },
                {
                    "N": "Aranaga",
                    "T": "Aranaga no saber lengua nara. Pero muchos nara pensar que recuerdos muertos y congelados, recuerdos perderse."
                },
                {
                    "N": "Aranaga",
                    "T": "Pero recuerdos vivos, fluir, no desaparecer. Recuerdos necesitar nutrirse."
                },
                {
                    "N": "Aranaga",
                    "T": "Sueños existir porque haber recuerdos. Si nutrir recuerdos, haber vida."
                },
                {
                    "N": "Aranaga",
                    "T": "Así, crecer cosa que ahuyentar a Marana."
                },
                {
                    "N": "Aranaga",
                    "T": "Humm... no sé cómo llamarse en lengua nara."
                },
                {
                    "N": "_0",
                    "T": "Te refieres a... ¿la valentía?"
                },
                {
                    "N": "Aranaga",
                    "T": "Sí, eso. Semillas necesitar ser fuertes para resistir a Marana. Solo semillas con cáscara dura no dejar que Marana entrar en ellas. Si semillas tener espinas, entonces pinchar a Marana."
                },
                {
                    "N": "_0",
                    "T": "Te refieres a... ¿la esperanza?"
                },
                {
                    "N": "Aranaga",
                    "T": "#Eh... Sí, nara {NICKNAME} rubi{F#a}{M#o}. Fluir, no verse, no tocarse: esperanza. Como viento, pero nunca desaparecer, así que también como sueños."
                },
                {
                    "N": "_0",
                    "T": "Te refieres a... ¿la sabiduría?"
                },
                {
                    "N": "Aranaga",
                    "T": "Sabiduría... Sabiduría ser recuerdos que fluir. Sabiduría estancada es guarida de Marana. Nara Váruna dijo: recuerdos que vivir crear sabiduría que vivir, así eliminar a Marana muerto, porque muerte no poder vencer vida."
                },
                {
                    "N": "Aranaga",
                    "T": "Pero primero, necesitar arahaoma para despertar Jamikayomars. Arahaoma necesitar flor barsam y setasura."
                },
                {
                    "N": "_0",
                    "T": "Ya lo tenemos todo listo."
                },
                {
                    "N": "Aranaga",
                    "T": "#Nara {NICKNAME} idéntic{F#a}{M#o} a nara Váruna, también rubi{F#a}{M#o}. Gracias."
                },
                {
                    "N": "Aranaga",
                    "T": "Cuando luna llegue a copa de árbol más alto, ustedes volver. Entonces, comenzar ritual del arahaoma."
                }
            ]
        ]
    },
